      out.write("    <script>\r\n");
      out.write("        // Solo ejecutar el cÃ³digo del mapa si existe el elemento #map\r\n");
      out.write("        if (document.getElementById('map')) {\r\n");
      out.write("            // Inicializar el mapa\r\n");
