      out.write("                } catch (e) { /* noop */ }\r\n");
      out.write("            }\r\n");
      out.write("\r\n");
      out.write("            function addHelpControl() {\r\n");
      out.write("                // BotÃ³n limpiar y ayuda breve como control Leaflet\r\n");
